import React from 'react';
import './App.css';
import './components/Header'
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';
import Home from './pages/home';

function App() {
  return (
    <Router>
      <ul>
        <li>
          <Link to="/" element={<Home />}>Home</Link>
        </li>
      </ul>
    </Router>
  )
}

export default App
